// import { useState } from 'react'
import './index.css'

const SubmitLink = () => {
    return (
        <div className='submit-link-container'>
            <h1 className='you-quiz-heading'>You-Quiz</h1>
            <form className='form' onSubmit={linkSubmitted}>
                <input type='text' className='link-input' placeholder='paste your link here' />
                <button type='submit' className='generate-btn'>Generate</button>
            </form>
        </div>
    )
}

export default SubmitLink
